import React from 'react';
import Navbar from "./Navbar";
import About from "./About";
import Education from "./Education";
import Skills from "./Skills"

import "./styles/styles.css"

function App() { 
  return (
    <>
      <Navbar/>
      <div className="resume" id="resume">
        <About/>
        <Education/>
        <Skills />
      </div>
    </>
  );
} 

export default App;
